@whitecosmos1996 @akshaygadipatil if you mean that you want to extract the trained model parameters then you can access those at any layer via `model.parameters()` or `model.named_parameters()`.

If you want to extract the data `x` going through a model forward pass you can extract that at any layer in the forward method of the model:
https://github.com/ultralytics/yolov3/blob/c906047db3a606441cffa0b8844bb4ae457bf06e/models.py#L216-L268
